import React from 'react';
import logo from '../logo.svg';

class Body extends React.Component{

    constructor(props){
        super(props);

        this.user = this.props.userDetails;
        this.add = this.props.userDetails.address;

        this.state = {
            "name" : "pavan"
        }


         // This binding is necessary to make `this` work in the callback
        this.handleClick = this.handleClick.bind(this);
    }

    handleEvent(e){
        e.preventDefault();
        
        console.log('The link was clicked.');
        
        this.state.setState({
            "name" : "Santosh"
        });
    }
    
    
    render(){
        
        return(
            <div>
                <img src={logo} className="App-logo" alt="logo" /> <br/>
                <button onClick="{handleEvent}"></button>
                <ul>
                    <li> <b> First Name: </b> {this.state.name}  </li>
                    <li> <b> Last Name: </b> {this.user.lastName}  </li>
                    <li> <b> Location: </b> {this.user.location}  </li>

                    <li> <b> City: </b> {this.add.city}  </li>
                    <li> <b> Pincode: </b> {this.add.pincode}  </li>
            
                </ul>
                <button className="btn btn-primary">On</button>
            </div>
        );
    }
}


export default Body;
